import React from "react";
import "./App.css";
import { Router, Switch, Route, Link } from "react-router-dom";
import LoginForm from "./components/loginForm";
function App() {
  return (
    <React.Fragment>
      <LoginForm />
      <div className="content">
        <Route path="/login" component={LoginForm} />
      </div>
    </React.Fragment>
  );
}

export default App;
